import { useEffect, useState } from 'react';
import '../App.css';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';

import { Checkbox } from "primereact/checkbox";
function ReceiptList(){

    const [ticket,setTicket]=useState()



    useEffect(()=>{
    fetch("http://localhost:8080/ticket",{
        method:"GET"
    })
    .then((res=>res.json()))
    .then((data)=>{

        const {content}=data


        setTicket(content)

    })


    const statusTiket=(rowData)=>{
        return(
            <input type="checkbox" checked={rowData.category} onChange={() => handleCheckboxChange(rowData)} />

        )
    }


    },[])
    console.log(ticket)
    return(
        <>

        <DataTable value={ticket} tableStyle={{ minWidth: '50rem' }}>
                <Column field="id" header="Code"></Column>
                <Column field="user.firstName" header="First Name"></Column>
                <Column field="user.lastName" header=" Name"></Column>
                <Column field="user.department" header="Departament"></Column>
                <Column  header="Ticket State" body={statusTiket} ></Column>
        </DataTable>

        </>)

    }
export default ReceiptList;
